def updateConcsForBothExcels(df, wb):
    df = df.to_numpy().tolist()
    ws = wb['Grid Numbers']
    max_row = ws.max_row
    alpha = list('ABCDEFGHIJKLMNOP')
    existing_excel_data = [[ws[r + str(i)].value for r in alpha] for i in range(3, max_row)]
    for i in range(3, max_row):
        conc_val = [ws['A' + str(i)].value, ws['B' + str(i)].value, ws['C' + str(i)].value, ws['D' + str(i)].value, ws['E' + str(i)].value, ws['F' + str(i)].value, ws['G' + str(i)].value]
        conc_val = str(ma.reTranslateData(conc_val))
        ws["O" + str(i)] = conc_val
        if len(str(ws['N' + str(i)].value)) > 5:
            ws['N' + str(i)] = str(ws['N' + str(i)].value)[:10]
    wb.save("C:\\Work\\newapds\\Casing_Review_Program_V1.xlsm")


    for i in range(len(df)):
        conc_val = str(ma.reTranslateData(df[i]))
        df[i][-2] = conc_val
        df[i][:6] = [int(float(j)) for j in df[i][:6]]
        if df[i][-2] == '1207S19ES' and df[i][6] == 'West-Down1':
            df[i][7], df[i][8], df[i][9], df[i][10], df[i][11] = 3272.6, 23, 7, 48, 1
        if df[i][-2] == '1207S19ES' and df[i][6] == 'South-Left2':
            df[i][7], df[i][8], df[i][9], df[i][10], df[i][11] = 0, 0, 0, 0, 0
        df[i][7:12] = [float(j) for j in df[i][7:12]]

    for i in range(len(df)):
        for j in existing_excel_data:
            if 'agrc' not in df[i][-1] and df[i][13] == j[14]:
                db = [float(k) for k in df[i][7:12]]
                exist = [float(k) for k in j[7:12]]
                if db == exist and len(str(j[13])) > 5:
                    df[i].insert(13, j[13])
                else:
                    df[i].insert(13, "")

    for i in range(len(df)):
        if len(df[i]) == 15:
            df[i].insert(13, "")

    df_test = [{'Section': i[0], 'Township': int(float(i[1])), 'Township Direction': i[2], 'Range': int(float(i[3])),
                'Range Direction': i[4], 'Baseline': i[5], 'Side': i[6], 'Length': i[7], 'Degrees': i[8], 'Minutes': i[9], 'Seconds': i[10], 'Direction': i[11], 'North Reference': i[12], "API": i[13], 'Conc': i[14], 'Version': i[15]} for i in df]
    df = pd.DataFrame(df_test, columns=['Section', 'Township', 'Township Direction', 'Range', 'Range Direction', 'Baseline', 'Side', 'Length', 'Degrees', 'Minutes', 'Seconds', 'Direction', 'North Reference', "API", 'Conc', 'Version'])
    df.to_csv("C:\\Work\\newapds\\PlatGridNumbers.csv", index = False )


