def transformDataIntoDatabaseFormat(data_base_lst, new_excel_data, new_version_data):
    new_version_conc = [i[-2][:9] for i in new_version_data]
    new_version_conc_unique = list(set([i[-2][:9] for i in new_version_data]))
    new_version_data = [i[:14] + [i[15]] for i in new_version_data]
    new_excel_data = [i[:14] + [i[15]] for i in new_excel_data]
    for i in range(len(new_version_conc_unique)):
        version_count = findNumberOfVersion(new_version_conc_unique[i], new_version_conc)
        new_version = 0
        for j in range(len(data_base_lst)):
            if new_version_conc_unique[i] in data_base_lst[j][-2]:
                # try:
                #     version_index = data_base_lst[j][-1].index("-")
                #     version_index_start = data_base_lst[j][-1].index("V.")
                #     current_data_version = int(float(data_base_lst[j][-1][version_index_start+2:version_index]))
                # except ValueError:
                current_data_version = int(float(data_base_lst[j][-1].replace("V.", "")))
                if current_data_version >= new_version:
                    new_version = current_data_version + 1
        if version_count:
            for j in version_count:
                for k in range(16):
                    new_version_data[(16 * j) + k].append("V." + str(j))
    ma.printLine(new_version_data)
    for i in range(len(new_version_data)):
        new_version_data[i][-1] = new_version_data[i][-1] + " - " + str(new_version_data[i][-3])[:10]
        new_version_data[i].pop(-3)
    ma.printLine(new_version_data)
    for i in range(len(new_excel_data)):
        new_excel_data[i].append("V.1" + " - " + str(new_excel_data[i][-2])[:10])
        new_excel_data[i].pop(-3)
    all_data = data_base_lst + new_version_data + new_excel_data
    for i in range(len(all_data)):
        # print(all_data[i])
        all_data[i][-2] = all_data[i][-2][:9]

    return all_data


